RIF. 313 Zona Cenisio Via Stilicone, all’interno di uno stabile signorile, con affaccio sulla storica villa Simonetta, a pochi passi dalla stazione MM Cenisio e dai principali servizi, proponiamo in vendita appartamento al piano secondo con doppio ingresso, composto da luminosissimo soggiorno doppio con ampie vetrate con vista sul parco di villa Simonetta, cucina abitabile, due camere, bagno, lavanderia, cantina e possibilità due posti auto. L’appartamento si presenta in ottime condizioni, con finiture di pregio, infissi appena rifatti, pavimenti in parquet e predisposizione per riscaldamento autonomo. Facilmente trasformabile in quadrilocale.
